	class CondRes
	{
		public int andIdx;
		public int orIdx;
		public int andCond;
		public int orCond;
		public int condIdx = -1;
		public int noTrue = 0;
		public int skipTrue = 0;
		public double noBenefit = 0;
		public double skipBenefit = 0;
		public double noPeriod = 0;
		public double skipPeriod = 0;
		public double noRatio = 0;
		public double skipRatio = 0;
		public double[] scores = new double[4];
		public int[] noBenys = new int[6];
		public int[] skipBenys = new int[6];
		public int[] confirmBenys = new int[6];
		public CondRes() { }

		public void SetScore(int i)
		{
			if (i == 0) {
				if (noBenefit == 0 || noTrue == 0 || noRatio == 0) {
					scores[i] = 0; return;
				}
				scores[i] = -(noBenefit * Math.Pow(noTrue, 0.9) * Math.Pow(noRatio, 2.5));
				//7004, //Score:7193.80390891577, sT:75200, sP:7.715, sB:-0.9481, sR:0.3212, nT:362778, nP:7.9275, nB:-1.6159, nR:0.3708
				return;
			}
			if (i == 1) {
				if (noBenefit == 0 || noTrue == 0 || noRatio == 0) {
					scores[i] = 0; return;
				}
				scores[i] = -(noBenefit * Math.Pow(noTrue, 1.5) * Math.Pow(noRatio, 3.5));
				return;
			}
			if (i == 3) {
				int confirmSum = 0; int noSum = 0;
				for (int beny = 0; beny < 6; beny++) {
					confirmSum += confirmBenys[beny];
					noSum += noBenys[beny];
				}
				double rate = (double)(confirmSum - noSum) / confirmSum;
				scores[i] = 0;
				if (rate == 0 )return;

				for (int beny = 0; beny < 6; beny++) {
					if(confirmBenys[beny] == 0) continue; 
					int diff = confirmBenys[beny] - noBenys[beny];
					double sc = ((double)diff / (double)confirmBenys[beny] / rate);
					if (beny == 0) { // ～-9
						scores[i] += Math.Pow(sc, 3);
					} else if (beny == 1) { // -8～-6
						scores[i] += Math.Pow(sc, 2);
					} else if (beny == 2) { // -5～-3
						scores[i] += Math.Pow(sc, 1.5);
					} else if (beny == 3) { // -2～0
						scores[i] += Math.Pow(sc, 1);
					} else if (beny == 4) { // 1～3
						scores[i] -= Math.Pow(sc, 1);
					} else if (beny == 5) { // 4～7
						scores[i] -= Math.Pow(sc, 1.5);
					}
				}


				return;
			}

			double ratio = i == 0 ? 0.8 : i == 1 ? 0.85 : i == 2 ? 0.9 : 0.95;
			scores[i] = Common.Round(Math.Pow(skipTrue, ratio) * skipBenefit / Math.Pow(skipPeriod, Condtions.PeriodPow)
			  + Math.Pow(noTrue, ratio) * noBenefit / Math.Pow(noPeriod, Condtions.PeriodPow) / Condtions.NoSkipRatio, 3);
		}

		public void SetNoBeny(int beny, int num, int confirmBeny)
		{
			noBenys[beny] = num; confirmBenys[beny] = confirmBeny;
		}
		public void SetSkipBeny(int beny, int num) { skipBenys[beny] = num; }

		public string DispRes()
		{
			return "\n" + condIdx + ", //Score:" + scores[3] + ", Beny:"+ DispBeny()
				+ ", sT:" + skipTrue + ", sP:" + skipPeriod + ", sB:" + skipBenefit + ", sR:" + skipRatio
				+ ", nT:" + noTrue + ", nP:" + noPeriod + ", nB:" + noBenefit + ", nR:" + noRatio;
		}
		public string DispBeny()
		{
			string res1 = "【Be1】"; string res2 = "【Be2】";
			int confirmSum = 0; int noSum = 0;
			for (int beny = 0; beny < 6; beny++) {
				confirmSum += confirmBenys[beny];
				noSum += noBenys[beny];
			}
			if(confirmSum==0)return res1 + ", " + res2;
			double ratio = (double)(confirmSum - noSum) / confirmSum;
			if (ratio == 0) return res1 + ", " + res2;

			for (int beny = 0; beny < 6; beny++) {
				if(confirmBenys[beny] == 0) continue;
				int diff = confirmBenys[beny] - noBenys[beny];
				res1 += beny + ":" + diff +"(" +((double)diff/ (double)confirmBenys[beny] / ratio) +"),";
				res2 += beny + ":" + noBenys[beny] + "/"+ confirmBenys[beny] + "/" + skipBenys[beny] +  ",";
			}
			return res1 + ", " +res2;
		}
	}

}
